  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Moosehorn NWR
  (including the Edmunds Unit) outlines Refuge accomplishments from February through
  April of 1940. The report begins by summarizing the weather conditions during this
  period. Wildlife- including migratory birds, big game animals, and predators- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes law enforcement.\",\n\t\"owner_org\":
